    <div className='container-fluid' style={{display:'flex', justifyContent:'center',marginTop:'15%'}}>
       <TailSpin
  height={height}
  width={width}
  radius="9"
  color="green"
  // ariaLabel="loading"
  // wrapperStyle
  // wrapperClass
/>
    </div>
   
  );
};

